// DIM Drill Dashboard - React + Tailwind + Supabase Starter (Now with Router + Layout Navigation)

import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { DrillDashboard } from './components/DrillDashboard';

function Home() {
  return (
    <div className="space-y-4">
      <p className="text-lg">Welcome to the DIM Drill Dashboard. Choose a section to begin.</p>
    </div>
  );
}

function DrillLibrary() {
  return <DrillDashboard />;
}

export default function App() {
  return (
    <Router>
      <div className="bg-[#1e1e1e] text-[#d0d0d0] min-h-screen p-6 max-w-5xl mx-auto">
        <h1 className="text-4xl font-bold text-orange-500 mb-8">DIM Drill Dashboard</h1>
        <nav className="flex gap-4 mb-8">
          <Link className="bg-orange-600 hover:bg-orange-500 text-white px-4 py-2 rounded" to="/">Home</Link>
          <Link className="bg-blue-600 hover:bg-blue-500 text-white px-4 py-2 rounded" to="/add">Add Drill</Link>
          <Link className="bg-green-600 hover:bg-green-500 text-white px-4 py-2 rounded" to="/library">Drill Library</Link>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/add" element={<DrillDashboard />} />
          <Route path="/library" element={<DrillLibrary />} />
        </Routes>
      </div>
    </Router>
  );
}
